//[奇遇]33[boss]buff属性package cn.mxz;public class BossBuffTemplet {	/** 	 * buffid 	 */	private int id;	/** 	 * buff名称 	 */	private String name;	/** 	 * 属性数值（百分比） 	 */	private float frontPar;	/** 	 * 属性上限(程序不读) 	 */	private float frontParMax;	/** 	 * 元宝消耗基数 	 */	private int sycee;	/** 	 * 下次元宝增加 	 */	private float addSycee;	/** 	 * 使用最大次数 	 */	private int number;	/**	 * buffid	 */	void setId(int id) {		this.id = id;	}	/**	 * buffid	 */	public int getId() {		return this.id;	}	/**	 * buff名称	 */	void setName(String name) {		this.name = name;	}	/**	 * buff名称	 */	public String getName() {		return this.name;	}	/**	 * 属性数值（百分比）	 */	void setFrontPar(float frontPar) {		this.frontPar = frontPar;	}	/**	 * 属性数值（百分比）	 */	public float getFrontPar() {		return this.frontPar;	}	/**	 * 属性上限(程序不读)	 */	void setFrontParMax(float frontParMax) {		this.frontParMax = frontParMax;	}	/**	 * 属性上限(程序不读)	 */	public float getFrontParMax() {		return this.frontParMax;	}	/**	 * 元宝消耗基数	 */	void setSycee(int sycee) {		this.sycee = sycee;	}	/**	 * 元宝消耗基数	 */	public int getSycee() {		return this.sycee;	}	/**	 * 下次元宝增加	 */	void setAddSycee(float addSycee) {		this.addSycee = addSycee;	}	/**	 * 下次元宝增加	 */	public float getAddSycee() {		return this.addSycee;	}	/**	 * 使用最大次数	 */	void setNumber(int number) {		this.number = number;	}	/**	 * 使用最大次数	 */	public int getNumber() {		return this.number;	}}